import React, { useState } from "react";
import { useEffect } from "react";



const Carrousel = () => {
    const [index, setIndex] = useState(0); // Estado inicial debe ser 0
    const images = [
    // Aquí debes proporcionar las imágenes con la propiedad 'url' y 'title'
    { url:"data:image/jpeg;base64,", title: "Imagen 1" },
    { url:"data:image/jpeg;base64,", title: "Imagen 2" },
    { url:"data:image/jpeg;base64,", title: "Imagen 3" },
    { url:"data:image/jpeg;base64,", title: "Imagen 4" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRV-Wj5SFOux8Hs5JVpBqxB0uZOtcE-UeqO1A&usqp=CAU", title: "Imagen 5" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQBJcBQ39sg_C-88v7gOwGmIKY3JQQYj9J1yg&usqp=CAU", title: "Imagen 6" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSBtELp2PeSB7jUg75Q59zKhILOt0tohmqXQg&usqp=CAU", title: "Imagen 7" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS--BlSfxA7i42q5a9P3biIWeeDr8KHJI9U7A&usqp=CAU", title: "Imagen 8" },
    { url:"data:image/jpeg;base64,", title: "Imagen 9" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTmBfpKsJp-1iGnl3CE4hGH6xExkq68pp4oDw&usqp=CAU", title: "Imagen 10" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSTSjlGIkyfdHA1xKpSqtSGVQeDlzpAsuqhOA&usqp=CAU", title: "Imagen 11" },
    { url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTqx1DU6FgiLyrgw3_q821uR9-APPiMMH58JA&usqp=CAU", title: "Imagen 12" }
    
];

const handlePrev = () => {
    setIndex((prevIndex) => {
        const newIndex = prevIndex - 4;
        return newIndex >= 0 ? newIndex : images.length - 4;
    });
};

    const handleNext = () => {
        setIndex((prevIndex) => {
            const newIndex = prevIndex + 4;
            return newIndex <= images.length - 4 ? newIndex : 0
        }); // Suma 4 al índice actual, pero asegura que no sea mayor que el índice máximo
};

useEffect(() => {
    setInterval(() => {
        handleNext();
    },5000)
}
,[]
);

  // Aquí obtendremos el grupo de imágenes a mostrar en el carrusel
    const currentImages = images.slice(index, index + 4);

    return (
        <div className="container mx-auto mt-20">
            <h2 className="text-center text-3xl bg-green-700 text-gray-100">Popular Mytineraries!</h2>
            <div className=" grid grid-cols-2 grid-rows-2 bg-gray-300 ">
            {currentImages.map((image) => (
                <div
                key={image.title}
                className="flex flex-col items-center border m-1 h-40"
                style={{ backgroundImage: `url(${image.url})`, backgroundSize: "cover", backgroundPosition: "center" }}
                >
                </div>
                ))}
            </div>
            <div className="grid grid-cols-2">
                <button className="bg-green-700 hover:bg-green-500 text-white font-bold py-2 px-4 rounded " onClick={handlePrev}>
                    Prev
                </button>
                <button className="bg-green-700 hover:bg-green-500 text-white font-bold py-2 px-4 rounded " onClick={handleNext}>
                    Next
                </button>
            </div>
        </div>
    );
};

export default Carrousel;